export const fetchWeather = createAsyncThunk(
  "weather/fetchWeather",
  async () => {
    const response = await fetch("https://api.openweathermap.org/data/2.5/weather?q=London&appid=0ae00247922956c17d86ed4e22c8879b");


  }
)

const weatherSlice =  createSlice({
  name: "weather",
